Future 是 Rust 的一个 trait（类似于 interface），表示一个异步任务（task），是"零成本"(zero-cost abstraction)的轻量级线程（类似 promise），会被交给 runtime 调度和执行。Future trait 需要实现 poll 这个方法，在 poll 中判断这个任务是否执行完，如果执行完（比如 IO 数据准备好），就返回 Ready，否则返回 Pending。 我们的代码不会直接调用 poll，而是通过 Rust 的关键字 .await 来执行这个 future，await 会被 Rust 在编译时生成代码来调用 poll，如果返回 Pending 则被 runtime 挂起（比如重新放到任务队列中）。当有 event 产生时，挂起的 future 会被唤醒，Rust 会再次调用 future 的 poll，如果此时返回 Ready 就执行完成。 除了直接实现 Future trait 以外，还可以通过 async 把一个 function 或者一个代码 block 转变为一个 Future。在 async 中可以调用其他 future 的 .await 来等待子 future 变成 Ready 状态。 struct HelloFuture { ready: bool, waker: ... } impl Future for HelloFuture { // 1. custom Future(leaf) fn poll(self: Self, ctx: &mut Context<'_>) -> Poll<()> { if self.ready { Poll::Ready(()) } else { // store waker in ctx somewhere Poll::Pending } }
} async fn hello_world() { // 2. generated Future by async println!("before await"); HelloFuture { ready: false }.await; // 3. HelloFuture is pending, then park println!("Hello, world!");
} fn main() { let task = hello_world(); // 4. task is a generated Future // ... reactor code is ignored here, which will wake futures runtime::spawn(task); // 5. task is run by runtime
} 例如上边这段代码，HelloFuture 是一个通过实现 Future trait 实现的 Future， hello_world 是 async 函数变成的 Future，并被传入 runtime 来执行（这里 runtime::spawn 只是示例）。hello_world 中又调用了 HelloFuture.await，因为 ready 是 false，所以 hello_world 会被挂起，直到 HelloFuture 被唤醒。 上述的这种嵌套的 futures 可以组成一个 Future 树，一般叶子节点都是由 runtime（如 Tokio） 自己通过实现 Future trait 来实现的，如 io、tcp、time 等操作。非叶子节点则由库代码或用户通过 async 调用不同的子 future 实现的。root future 会被提交给 runtime 来执行，runtime 通过调度器来调用 root future，然后 root 再一级级往下调用 poll。 https://excalidraw.com/#json=6697978081312768,u9VYjoGonibMqcPX8VWeGg

