Future 会被 Rust 编译为一个状态机的代码，当执行到子 Future 的 await 的时候，会进入下一个状态，所以下次执行时可以从 await 的地方继续执行。因此 Rust 不需要预先为 future 分配独立的栈（stackless），是 zero-cost abstraction。但也因为如此，future 只能在 await 的地方调度走，是 cooperation scheduling（协同调度），而且很难做抢占式调度，这点和 stackful 的 Go/Erlang 不一样。状态机的示意伪代码如下： use std::{future::Future, task::Poll}; enum HelloWorldState { Start, Await1(HelloFuture), Done,
} impl Future for HelloWorldState { type Output = (); fn poll(&mut self: HelloWorldState, ctx: &mut Context<'_>) -> Poll<Output> { match self { HelloWorldState::Start => { println!("before await"); // code before await let hello = HelloFuture { ready: false }; *self = HelloWorldState::Await1(hello); self.poll(); // re-poll after first state change }, HelloWorldState::Await1(hello) => { match hello.poll(ctx) { // await by poll Poll::Pending => { Poll::Pending }, Poll::Ready(output) => { println!("Hello, world!"); // code after await *self = HelloWorldState::Done; let output = (); Poll::Ready(output) } } }, HelloWorldState::Done => { panic!("can't go here") } } }
} 在这段示意代码中， async fn hello_world() 被变成了一个 enum 的状态和它的 poll 方法，初始状态为 Start，第一次执行 poll 时会执行 .await 之前的代码，并改变当前状态为 Await1 。下次再被 poll 时，因为状态是 Await1，会进入第二个分支并执行 hello.poll()，如果 hello 还没完成，会返回 Pending，否则会执行 .await 之后的代码。 可以看到，Rust 主要提供了这些基础的工具和代码生成，而如何管理 OS 线程、如何调度任务、如何 poll events、如何唤醒 pending 的 tasks 等等，都需要 runtime 自己实现，可以实现为一个类似于 Erlang/Go 的 N:M 模型，也可以实现 Nodejs 这样单线程事件驱动的模型。 需要注意的是，如果使用了 async，很多标准库中的同步阻塞的库就不应该直接使用，否则会阻塞其他 task 的调度和运行。比如执行 std::println! 或者执行纯 CPU 计算的时候，因为没有 .await 这样的 yield point，所以无法被调度走，当前 OS 线程必须等到这个操作完成，执行到下一个 yield point 后，才能执行其他 task，这段时间内这个 OS 线程中的任务都被阻塞了。 一般 runtime 会封装好一些常用的模块，如 IO/TCP/timer 等等，写代码时注意使用 runtime 封装的而不用标准库的就行。像 Tokio 这样的 runtime 还提供了专门用来运行这类阻塞操作的专用线程池（类似于 Erlang 的 dirty scheduler），从而不影响 reactor 或者其他 task 的执行。

